        /// <param name="csillagokSzáma">A felhasználó által megadott 5 és 25 közötti pozitív egész szám</param>
        public Játék(int csillagokSzáma)
        {
            if (csillagokSzáma < 5)
                this.csillagokSzáma = 5;
            else if (csillagokSzáma > 25)
                this.csillagokSzáma = 25;
            else
                this.csillagokSzáma = csillagokSzáma;
            csillagokSzáma = this.csillagokSzáma;
            Random prnd = new Random();
            pályaSorszáma = prnd.Next(0, pályák.GetLength(0));
            Console.WriteLine(pályák.GetLength(0));
            for (int i = 0; i < pályák.GetLength(1); i++)
            {
                for (int j = 0; j < pályák.GetLength(2); j++)
                {
                    választottPálya[i, j] = pályák[pályaSorszáma, i, j];
                }
            }
            /* Enélkül a seed nélkül a csillagok elhelyezése nem eléggé véletlenszerű, a pálya téglalap-
             * és nem szabályos négyzet alakja ellenére az átló mentén helyezkednek el.
             * (lásd: dokumentáció ) */
            Random rndSeed = new Random();
            Random rndX = new Random(rndSeed.Next(1, 1111));
            Random rndY = new Random(rndSeed.Next(2, 2222));
            while (csillagokSzáma > 0)
            {
                int x = rndX.Next(2, 71);
                int y = rndY.Next(2, 21);
                if (választottPálya[y, x] == ' ')
                {
                    választottPálya[y, x] = '*';
                    csillagokSzáma--;
                }

            }
        }
        #endregion

        #region Publikus metódus
        /// <summary>
        /// Maga a játék
        /// </summary>
        public void Start()
        {
            
            Kommunikáció.Kiír(választottPálya, játékos.X, játékos.Y, játékos.Karakter, csillagokSzáma, pályaSorszáma, lépésekSzáma);
            bool vége = false;
            while (!vége)
            {
                ConsoleKeyInfo x = Console.ReadKey(true);
                switch (x.Key)
                {
                    case ConsoleKey.LeftArrow:
                        if (választottPálya[játékos.Y, játékos.X - 1] != '#' && (választottPálya[játékos.Y, játékos.X - 1] != '=' || csillagokSzáma == 0))
                        {
                            játékos.X--;
                            lépésekSzáma++;
                        }
                        break;
                    case ConsoleKey.RightArrow:
                        if (választottPálya[játékos.Y, játékos.X + 1] != '#' && (választottPálya[játékos.Y, játékos.X + 1] != '=' || csillagokSzáma == 0))
                        {
                            játékos.X++;
                            lépésekSzáma++;
                        }
                        break;
                    case ConsoleKey.UpArrow:
                        if (választottPálya[játékos.Y - 1, játékos.X] != '#' && (választottPálya[játékos.Y - 1, játékos.X] != '=' || csillagokSzáma == 0))
                        {
                            játékos.Y--;
                            lépésekSzáma++;
                        }
                        break;
                    case ConsoleKey.DownArrow:
                        if (választottPálya[játékos.Y + 1, játékos.X] != '#' && (választottPálya[játékos.Y + 1, játékos.X] != '=' || csillagokSzáma == 0))
                        {
                            játékos.Y++;
                            lépésekSzáma++;
                        }
                        break;
                    default:
                        break;
                }
                while (Console.KeyAvailable)
                {
                    x = Console.ReadKey(false);
                }
                if (választottPálya[játékos.Y, játékos.X] == '*')
                {
                    választottPálya[játékos.Y, játékos.X] = ' ';
                    csillagokSzáma--;
                }
                if (választottPálya[játékos.Y, játékos.X] == '=')
                    vége = true;
                Kommunikáció.Kiír(választottPálya, játékos.X, játékos.Y, játékos.Karakter, csillagokSzáma, pályaSorszáma, lépésekSzáma);
                Thread.Sleep(10);
            }
        }
        #endregion
    }
}
